INSERT INTO `tbl_companyarticles` (`article_id`, `parent_article`, `title`, `alias`, `text`, `cover_photo`, `display_order`, `status`, `created_at`, `updated_at`, `createdby`, `updatedby`) VALUES
(1, 0, 'WELCOME TO JUPITER OVERSEAS CONCERN P.LTD.', 'welcome_to_hcrr', '<p>In the past few years, Nepalese People have been widely accepted, welcomed and extended in various occupations and capacities in the foreign employment sector. Therefore, Nepalese are well known for their loyalty, honesty, courage simplicity and hard work in different countries around the world.</p><ul><li>Nepalese workers are eminent for their hard work, loyalty, high sense of responsibility and discipline.</li><li>Nepalese workers are calm, and extremely loyal to their employers and they are devoted to their duties only.</li><li>Nepalese workers have experience in working in the extreme climatic conditions.</li><li>Nepalese workers are comparatively more cost effective and their hiring cost is nominal in comparison to other labor exporting countries.</li><li>The employers have the advantage of \'choice\' due to availability of various types workers (professional, skilled, semi-skilled and unskilled) for immediate placement.</li><li>Procedures and formalities for recruiting Nepalese workers for overseas employment are simple and easy.</li><li>Nepal is situated very close to the labor importing countries and have air link with almost all the major cities of the world.</li></ul><p>&nbsp;</p>', '', 9, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(15, 0, 'Our Opportunities & Strengths', 'our_objectives', '<p>After the SWOT analysis we conclude following strengths of our company:</p><ul><li>Conduct Systematic recruitment, sufficient international business partners, enough availability of local network to search capable candidates.</li><li>Deliver high quality Manpower.</li><li>Continuously keep on contact and get feedback from client and candidates.</li><li>Maintain our commitments to all our clients and candidates.</li></ul>', '', 5, 1, NULL, '2023-07-13 23:18:18', NULL, 1),
(24, 0, 'Our Motto & Mission', 'motto_and_mission', '<p>Jupiter\'s mission is to strategically position itself as a leading recruitment resource, delivering tailored solutions and exceptional candidate selection to meet the evolving demands of the industry. With a focus on transparency, trust, and exceptional service, Jupiter aims to exceed expectations and become the preferred choice for organizations and individuals in search of exceptional talent and fulfilling career opportunities.</p><p>&nbsp;</p><p><br>&nbsp;</p>', '', 2, 1, NULL, '2023-07-13 23:18:18', NULL, 1),
(25, 0, 'Vision', 'vision', '<p>Becoming the leading recruitment resource, Jupiter strives to deliver exceptional candidate selection and value-added services, exceeding expectations in a dynamic industry. By staying ahead of emerging trends and building strong client relationships, we aim to be the preferred choice for exceptional talent and fulfilling career opportunities.</p><p>&nbsp;</p>', '', 7, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(37, 0, 'Commitment', 'commitment', '<p>Jupiter Overseas Concern Pvt. Ltd. is committed to providing strategic and tailored recruitment solutions, adapting to the evolving landscape and exceeding client expectations. With a focus on exceptional service, transparency, and strong relationships, Jupiter aims to be the preferred choice for organizations and individuals in search of top-notch talent and fulfilling career opportunities.</p><p>&nbsp;</p><p><br>&nbsp;</p>', '', 36, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(38, 0, 'faq', 'faq', '', '', 19, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(39, 38, ' What services does Jupiter Overseas Concern Pvt. Ltd. provide?', 'first_faq', '<p>Jupiter Overseas Concern Pvt. Ltd. provides a range of services including recruitment and staffing, candidate selection and screening, international placement and documentation, employer branding and positioning, consultation and strategic planning, and value-added services.</p>', '', 20, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(40, 0, 'Instructions for Resume', 'instructions_for_resume', '<p>When creating a resume for foreign employment through Jupiter Overseas Concern Pvt. Ltd., it\'s important to highlight your<strong> skills, experience, and qualifications</strong> in a clear and concise manner. Follow these instructions to ensure your resume stands out:</p><p><strong>Contact Information:</strong></p><ul><li>Include your full name, current address, phone number, and email address.</li><li>If applicable, mention your LinkedIn profile or other relevant professional websites.</li></ul><p><strong>Professional Summary:</strong></p><ul><li>Write a brief paragraph highlighting your key skills, experience, and career objectives.</li><li>Emphasize your suitability for the desired job and your motivation to work abroad.</li></ul><p><strong>Work Experience:</strong></p><ul><li>List your work history in reverse chronological order (starting with the most recent position).</li><li>Include the company name, job title, location, and employment dates.</li><li>Describe your responsibilities, achievements, and notable contributions to each role.</li><li>Highlight any international experience or cross-cultural skills.</li></ul><p><strong>Education and Certifications:</strong></p><ul><li>Mention your educational background, including degrees, diplomas, and certifications.</li><li>Include the institution name, location, dates attended, and any honors or awards received.</li><li>If relevant, mention any specialized training or courses related to the desired job.</li></ul><p><strong>Skills:</strong></p><ul><li>Enumerate your relevant skills, such as language proficiency, technical expertise, or specific industry knowledge.</li><li>Tailor your skills section to match the requirements of the job you\'re applying for.</li></ul><p><strong>Language Proficiency:</strong></p><ul><li>Specify your proficiency in languages, particularly English and any other relevant languages.</li><li>Indicate your level of proficiency (e.g., basic, intermediate, advanced) for each language.</li></ul><p><strong>Personal Information:</strong></p><ul><li>Include your nationality, date of birth, and marital status.</li><li>Optionally, mention any personal interests or hobbies that demonstrate your well-rounded personality.</li></ul><p><strong>References:</strong></p><ul><li>If requested, provide the names and contact details of professional references who can vouch for your abilities and character.</li></ul><p><strong>Formatting:</strong></p><ul><li>Keep your resume well-organized, using clear headings and bullet points.</li><li>Use a professional font and ensure readability.</li><li>Limit the resume length to one or two pages.</li></ul><p><strong>Proofread and Review:</strong></p><ul><li>Double-check your resume for any spelling or grammatical errors.</li><li>Review the content to ensure it effectively represents your skills and experiences.</li></ul>', '', 21, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(41, 0, 'Information on Hiring Process', 'information_on_hiring_process', '<p>The hiring process at Jupiter Overseas Concern Pvt. Ltd. follows a systematic approach to ensure efficient and effective candidate selection. While specific details may vary, here is a general overview of the hiring process:</p><p><strong>Job Posting and Advertising:</strong></p><ul><li>Jupiter advertises job vacancies through various channels, both online and offline, to attract potential candidates.</li><li>Job descriptions and requirements are clearly outlined to attract relevant applicants.</li></ul><p><strong>Application Submission:</strong></p><ul><li>Interested candidates submit their applications, either online through the Jupiter Overseas Concern Pvt. Ltd. website or through other designated platforms.</li><li>Applicants typically provide their resumes, cover letters, and any other requested documents.</li></ul><p><strong>Resume Screening and Shortlisting:</strong></p><ul><li>Jupiter\'s recruitment team reviews the received applications and screens resumes to assess candidates\' qualifications, skills, and experience.</li><li>Suitable candidates are shortlisted based on their alignment with the job requirements.</li></ul><p><strong>Interviews and Assessments:</strong></p><ul><li>Shortlisted candidates are invited for interviews, which may be conducted in person, over the phone, or via video conferencing.</li><li>Interviews aim to assess the candidates\' competencies, qualifications, cultural fit, and suitability for the position.</li><li>Depending on the role, candidates may also undergo additional assessments or skill tests to evaluate their capabilities.</li></ul><p><strong>Reference Checks and Background Verification:</strong></p><ul><li>Prior to final selection, Jupiter may conduct reference checks to validate candidates\' credentials and previous work experience.</li><li>Background verification may also be performed to ensure the accuracy of the information provided by candidates.</li></ul><p><strong>Job Offer and Negotiation:</strong></p><ul><li>After the selection process, Jupiter extends a job offer to the chosen candidate, outlining the terms and conditions of employment.</li><li>If necessary, negotiations may occur to finalize aspects such as salary, benefits, and start date.</li></ul><p><strong>Documentation and Visa Processing:</strong></p><ul><li>Once the candidate accepts the job offer, Jupiter guides them through the documentation process, including visa processing, work permits, and other legal requirements.</li><li>Candidates are provided with support and assistance in fulfilling all necessary paperwork and documentation.</li></ul><p><strong>Pre-Departure Preparation:</strong></p><ul><li>Jupiter conducts pre-departure orientations and provides necessary information to the selected candidates to prepare them for their journey and work abroad.</li><li>This includes guidance on cultural norms, workplace expectations, and any other relevant information to ensure a smooth transition.</li></ul>', '', 22, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(42, 0, 'Labor Law', 'labor_law', '<p>Nepal\'s labor law provides comprehensive protection and regulations for workers in the country. The law covers various aspects, including minimum wage, working hours, leave entitlements, workplace safety, and social security. It ensures equal pay for equal work, prohibits child labor, and promotes gender equality in employment. The law also grants workers the right to form trade unions and engage in collective bargaining. Employers are required to comply with these regulations, provide safe working conditions, and ensure timely payment of wages. Violations of labor rights can result in legal action and penalties, promoting fair treatment and protection for Nepalese workers.</p><p>&nbsp;</p><p><br>&nbsp;</p>', '', 23, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(27, 0, 'Our Services', 'our_services', '<p>Recruitment, selection and placement of quality staff has been a major part of Aarav Global Recruitment Pvt. Ltd’s dedicated and professional services since its inception. The skill shortage worldwide has created such a demand for ourrecruitment services. We assist International employers in selecting the right people required for their project. We co-operate job seekers who want to work abroad and provide opportunities to share their experiences globally.<br>Recruitment, selection and placement of quality staff has been a major part of Aarav Global Recruitment Pvt. Ltd’s dedicated and professional services since its inception. The skill shortage worldwide has created such a demand for ourrecruitment services. We assist International employers in selecting the right people required for their project. We co-operate job seekers who want to work abroad and provide opportunities to share their experiences globally.</p>', '', 11, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(23, 0, 'Welcome to Jupiter Overseas Concern Pvt. Ltd', 'welcome_to_hcrr230521071403', '<p>Since its inception, Jupiter Overseas Concern Pvt. Ltdhas emerged as a trusted name in the recruitment market. We specialize in sourcing and recruiting professional, skilled, semi-skilled, and unskilled workers from Nepal, providing top-notch talent solutions to meet the growing demands of various industries.With our unwavering commitment to excellence, Human Care Resource and Recruitment has experienced remarkable growth and expansion, establishing a robust corporate structure to better serve our valued clients. As the demand for foreign workers continues to rise in regions such as the Middle East, Malaysia, Japan, and Europe, we have adapted by developing a modern corporate infrastructure, fostering effective communication channels, and assembling highly experienced teams. We understand the critical role that talent plays in driving organizational success.At Human Care Resource and Recruitment, our success is built upon a foundation of integrity, professionalism, and excellence. We adhere to the highest ethical standards, ensuring that all our processes are transparent, fair, and compliant with international recruitment regulations. Our dedication to quality service has earned us the trust and loyalty of our clients, who continue to rely on us for their talent acquisition needs.<br>&nbsp;</p>', '', 6, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(18, 0, 'Message from MD', 'message_from_md', '<p>We are feeling proud to note here that we have been working in the field of Human Resource Mobilization for a decade. In Nepal, unemployment problem is rising in geometrical ratio and it is going to be a burning issue too. Nepal is prosperous for its great human resources that have various categories. Unskilled, semi-skilled, skilled and professional manpower are seeking appropriate opportunity of employment, but very few of them get chance. Keeping this entire situation in my mind and realizing own-self a conscious member of the society, We decided to \'mobilize unemployment human resource\' as our prime duty.</p><p>&nbsp;</p><p>We acquired the knowledge of loyalty, responsibility and honesty from our ten years\' experience of this field and we came to the conclusion that the prime duty of Human Resource Mobilization Company is to satisfy both the ends (the employer and the employee). Besides this, the Manpower Supply Company should be responsible for its legality, concerned rules and regulations. Both parties should be honest and sincere to implement their terms and conditions. If one fails to be honest in his concerned terms and conditions, certainly the defaulter must bear a heavy detriment.</p><p>&nbsp;</p><p><strong>JUPITER OVERSEAS CONCERN PVT. LTD.</strong> is a reputed agency having government recognition and registration for the mobilization of Human Resources, especially on request or demand by an employer.</p><p>&nbsp;</p><p>We spent a lot of time in visiting different countries like Malaysia, Singapore, Bahrain, the Gulf countries, India, Hong Kong and Bangladesh in the due course of our profession. We deal with a lot of agencies, companies and institutions of aforesaid countries perfectly and honestly during my engagement with human resource supply occupation. We are grateful to all of the concerned foreign employer companies for extending their kind co-operation to our agency and us. We also like to thank our staff members for their efficiency, hard work and sincerity, which is playing a great role in the prosperity of this agency.</p><p>&nbsp;</p><p>We heartily apologize for the errors and inaccuracy if there have been any in this prospectus, and we also hope it would be fruitful, helpful and potential for all the concerned bodies.</p>', '', 1, 1, NULL, '2023-07-13 23:48:09', NULL, 1),
(19, 0, 'Quality and professionalism', 'quality_professionalism', '<p><strong>QUALITY</strong></p><p>We believe that quality is the foundation of our success. That is why we strive to deliver HR services that meet the highest standards of quality and professionalism. We work closely with our clients to understand their unique needs and requirements, and we tailor our services to meet those needs effectively.</p><p>&nbsp;</p><p><strong>PROFESSIONALISM</strong></p><p>At Jupiter Overseas, we are committed to professionalism in all our operations, and we believe that this is what sets us apart from our competitors. We are dedicated to providing high-quality services to our clients, and we believe that our commitment to professionalism is what makes us a valuable asset to any business. We believe that professionalism is the key to our success, and we strive to maintain the highest standards of professionalism in all our operations.</p><p>Recruitment and selection are critical components of our services, and we understand the importance of identifying the best talent for our clients. We employ a range of techniques and tools to ensure that the recruitment process is transparent, fair, and unbiased. Our team of highly skilled professionals is dedicated to providing guidance and support to candidates throughout the recruitment process, and we maintain strict confidentiality in all our dealings with both clients and candidates.</p>', '', 8, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(20, 0, 'Strategy and Positioning ', 'strategy_positioning', '<p><strong>STRATEGY</strong></p><p>We are committed to delivering exceptional HR services that meet the needs and expectations of our clients. Our strategy and positioning focus on three key areas: quality, innovation, and partnership.</p><p>&nbsp;</p><p><strong>POSITIONING</strong></p><p>Our positioning is focused on delivering HR services that are comprehensive, flexible, and cost-effective. We offer a wide range of HR services, including recruitment, employee engagement, training and development, payroll management, and more. Our services are designed to be flexible and adaptable, so that we can tailor them to meet the specific needs and requirements of our clients. And we are committed to delivering our services in a cost-effective manner, so that our clients can get the most value for their investment.</p><p>Overall, our strategy and positioning are focused on delivering HR services that meet the highest standards of quality and professionalism, while also being innovative, flexible, and cost-effective. We believe that this approach allows us to deliver exceptional HR services that help our clients achieve their HR goals and objectives, and ultimately contribute to their long-term success</p>', '', 4, 1, NULL, '2023-07-13 23:18:18', NULL, 1),
(35, 0, 'test', 'test', '<p>test</p>', '', 16, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(28, 0, 'mission_vision_and_objectives', 'mission_vision_and_objectives', '<p>Jupiter acknowledges the vital importance of strategy and positioning in the dynamic realm of recruitment. By thoroughly analyzing market trends and comprehending the evolving needs of our clients, we formulate a strategic approach that sets us apart from others in the industry. Our main objective is to align our services with the changing demands of the recruitment landscape, providing tailored and effective solutions to our clients. We position ourselves as a dependable partner, utilizing our expertise to deliver exceptional candidate selection and value-added services that go beyond expectations. Through strategic planning and positioning, our goal is to establish Jupiter as the foremost resource for top-notch recruitment services, ensuring long-term success for both our clients and candidates.</p><p>In a constantly evolving recruitment landscape, Jupiter remains dedicated to staying ahead of the curve. Our strategic approach enables us to adapt and thrive, anticipating emerging trends and adjusting our services accordingly. By positioning ourselves as a trusted partner, we cultivate strong relationships with our clients based on transparency, trust, and exceptional service. We strive to exceed expectations by presenting carefully selected candidates who not only possess the necessary skills and experience but also align with our clients\' unique organizational culture. Through our unwavering commitment to strategy and positioning, Jupiter aspires to become the preferred choice for organizations seeking exceptional talent and individuals searching for fulfilling career opportunities.</p>', '', 3, 1, NULL, '2023-07-13 23:18:18', NULL, 1),
(32, 0, 'SALIENT FEATURES', 'salient_features', '<p>In the past few years, Nepalese People have been widely accepted, welcomed and extended in various occupations and capacities in the foreign employment sector. Therefore, Nepalese are well known for their loyalty, honesty, courage simplicity and hard work in different countries around the world. It is worthy to be reminded here that Nepalese government has launched a nation-wide policy to systemize the recruitment of unemployed human resources through manpower agencies.</p><p>To contribute in the mobilization procedure of Nepalese human resources, Jupiter Overseas Concern Pvt. Ltd. was established in 2061 B.S. JOC is legally registered with HMG of Nepal, Ministry of Commerce, under the Company Act 2053 and obtained permission to act in foreign employment profession (as per the decision of HMG, Ministry of Labor). JOC having a lawful authority is in operation with its fully equipped modern office at Shlesmantak Marg, Sinamangal-9, Kathmandu, Nepal. The location of JOC is convenient for everyone. It is only 1 kilometer far from the Tribhuwan International Airport.</p><p>Now, Jupiter Overseas Concern Pvt. Ltd. employed more than thousands of professionals including skilled, semi-skilled and unskilled manpower in different countries around the world. JOC office is in operation with a group of young, energetic, dynamic, dedicated and result-oriented team. The entire staff members have great emphasis on customer satisfaction for the achievement of mutual benefit of the employee and the employer. They are also conscious to tie up decent friendship for the benefit of the nation. They are familiar with the local rules, regulations and practices. The workers recruited by JOC are advised to behave well and obey the existing rules and regulations of the employing authorities. The motto of JOC is Fast, Efficent and Secure. JOC always arranges interview sessions and other necessary procedures to select the best and qualified candidates keeping in mind the optimum satisfaction of the employer. In order to promote the sustainable relationship especially with the employing countries and agencies, JOC is always attentive to provide the excellent service to its clients.</p><p>A small but systematic team of experienced and competent staff manages Jupiter Overseas Concern Pvt. Ltd. All of the members are well aware and have the knowledge of the local labor laws, international practices, medical requirements and labor situations. All of them are fully confident and competent enough to identify and recruit the right person for the right job whenever a demand letter is received from an employer of foreign countries.</p>', '', 13, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(31, 0, 'OUR GOALS & OBJECTIVES', 'our_goals_objectives', '<p>Jupiter Overseas Concern Pvt. Ltd. strictly abides by the rules and regulations of Foreign Employment Act of 2042 B.S. that solely governs this profession. Under the direction and supervision of HMG of Nepal, Labor Ministry, Labor and Transport Department, JOC Pvt. Ltd. is dealing the supply work of different types of labors and professionals to foreign employment providing the chance to place the right person in the right job. JOC\'s main objectives are as follows:</p><ul><li>To produce and receive permission from international agencies, associations, companies, firms, commercial and non-commercial organizations (service seekers) for the necessary agreement papers (to supply the manpower) and to act accordingly, abiding the rules and of Foreign Employment Act of the land.</li><li>To deal with perspective foreign companies and organizations to provide employment opportunities to the Nepalese unemployed human resources in the international labor market as per the national strategy of HMG of Nepal, Labor Ministry, Labor and Employment Promotion Department.</li><li>To act as the proper channel for the mutual communication between employee and employee\'s family.</li><li>To work in overall basis to secure on-the-job rights, benefits and welfare of the employee and his family who are employed through this Concern.</li><li>To impart the necessary management to enhance unskilled and semi-skilled employees by organizing training, seminars, orientation and symposium as required by them to make them qualified and perfect in their profession.</li><li>To provide medically fit manpower as asked under the rules and regulations by the immigration of an employer.</li></ul>', '', 12, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(33, 0, 'REASONS TO RECRUIT NEPALESE WORKERS IN ABROAD', 'reasons_to_recruit_nepalese_workers_in_abroad', '<p>Over the past one and a half decade, an increasing number of employers from different countries are showing their keen interest in hiring Nepalese workers. Most of them diverted attention from their original labor supplying countries towards Nepal. This change, in fact, is due to the following reasons:</p><ul><li>Nepalese workers are eminent for their hard work, loyalty, high sense of responsibility and discipline.</li><li>Nepalese workers are calm, and extremely loyal to their employers and they are devoted to their duties only.</li><li>Nepalese workers have experience in working in the extreme climatic conditions.</li><li>Nepalese workers are comparatively more cost effective and their hiring cost is nominal in comparison to other labor exporting countries.</li><li>The employers have the advantage of \'choice\' due to availability of various types workers (professional, skilled, semi-skilled and unskilled) for immediate placement.</li><li>Procedures and formalities for recruiting Nepalese workers for overseas employment are simple and easy.</li><li>Nepal is situated very close to the labor importing countries and have air link with almost all the major cities of the world.</li></ul>', '', 14, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(34, 0, 'WHY CHOOSE JUPITER OVERSEAS CONCERN PVT. LTD.?', 'why_choose_jupiter_overseas_concern_pvt_ltd', '<ul><li>JOC always has a reserve of potential candidates of different categories so that the supply of proper manpower can be made immediately as per the requisition of the employer.</li><li>JOC has extended its local offices to different districts of Nepal and even has appointed some marketing personnel in certain countries like U.A.E. and Malaysia. This makes the rapid flow of information and strong management.</li><li>JOC deals systematically and smoothly all the necessary legal procedures that makes the deployment of workers quick and effective.</li><li>JOC takes full responsibility and guarantee for the welfare and benefit of the workers and its supplies.</li><li>JOC team is capable and tactful to handle the circumstances.</li></ul><p>If JOC has any opportunity of service, it will endeavor to heighten the glory of the business and it will try its best to keep it always in high spirit. JOC looks forward for your valuable advice, suggestions and healthy criticism that it will keep JOC always in the right track. JOC hopes your kind consideration for placing it in your priority list and to remember for forthcoming recruitment of Nepalese manpower for your esteem corcern.</p><p>&nbsp;</p><p>Jupiter Overseas Concern Pvt. Ltd. has established with a motto is Fast, Efficent and Secure, to serve the unemployed but capable Nepalese people as well as to the nation. The prime factors behind the story of its success are, it is always supported by excellent management, reliance on its prompt communication system and the quality of its service. In addition, the following statements may be the plus point for the success of JOC.</p>', '', 15, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(36, 0, 'footer_intro', 'footer_intro', '<p>Choose Jupiter as your trusted recruitment partner, and together, we will shape a future filled with outstanding opportunities and remarkable achievements.</p>', '', 17, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(43, 0, 'Resources for Skill Development', 'resources_for_skill_development', '<p>Jupiter Overseas Concern Pvt. Ltd. offers a range of skill development resources to enhance the capabilities of individuals seeking foreign employment. While specific offerings may vary, here are some common skill development resources that Jupiter may provide:</p><p><strong>Language Training:</strong></p><ul><li>Jupiter may offer language courses to help individuals improve their proficiency in languages commonly required for foreign employment, such as English, Arabic, or other relevant languages.</li><li>These language training programs aim to enhance communication skills, vocabulary, grammar, and overall language fluency.</li></ul><p><strong>Technical and Professional Training:</strong></p><ul><li>Jupiter may provide technical and professional training programs to enhance specific job-related skills and knowledge.</li><li>These programs could include industry-specific training, certification courses, and workshops to improve expertise in fields such as healthcare, engineering, hospitality, information technology, and more.</li></ul><p><strong>Cross-Cultural Training:</strong></p><ul><li>To help individuals adapt to different cultural environments, Jupiter may offer cross-cultural training programs.</li><li>These programs focus on developing intercultural communication skills, understanding cultural norms and etiquette, and fostering cultural sensitivity.</li></ul><p><strong>Soft Skills Development:</strong></p><ul><li>Jupiter may provide resources for developing essential soft skills, such as communication, teamwork, leadership, problem-solving, and adaptability.</li><li>These skill development programs aim to enhance personal and professional attributes that are highly valued in the global job market.</li></ul><p><strong>Pre-departure Orientation:</strong></p><ul><li>Prior to individuals\' departure for foreign employment, Jupiter may offer pre-departure orientation sessions or workshops.</li><li>These sessions provide valuable information about the destination country\'s culture, work environment, legal requirements, safety measures, and practical tips for a successful transition.</li></ul><p><strong>Resume Writing and Interview Skills:</strong></p><ul><li>Jupiter may assist individuals in improving their resume writing and interview skills to effectively showcase their qualifications and increase their chances of securing employment abroad.</li><li>They may provide guidance on structuring resumes, highlighting relevant experience, and conducting mock interviews to enhance interview performance.</li></ul>', '', 24, 1, NULL, '2023-07-13 18:37:38', NULL, 1),
(44, 0, 'Employer Service and Solutions', 'employer_service_and_solutions', '<p><br>Jupiter Overseas Concern Pvt. Ltd. offers a range of employer services and solutions to cater to the recruitment needs of organizations. Some of the key services provided by Jupiter Overseas Concern Pvt. Ltd. include:</p><p><strong>Recruitment and Staffing:</strong></p><ul><li>Jupiter assists employers in sourcing and selecting suitable candidates for their job vacancies.</li><li>They employ a comprehensive recruitment process that includes candidate screening, interviews, and skill assessments to ensure the right fit for the job.</li></ul><p><strong>Candidate Selection and Screening:</strong></p><ul><li>Jupiter conducts thorough background checks, verifies credentials, and screens candidates to ensure their suitability for the job.</li><li>They assess candidates\' skills, qualifications, experience, and cultural fit, providing employers with a shortlist of well-qualified candidates.</li></ul><p><strong>International Placement and Documentation:</strong></p><ul><li>Jupiter handles the necessary paperwork and documentation required for international placements, including visa processing and legal compliance.</li><li>They ensure that candidates meet the legal and regulatory requirements of the destination country, facilitating a smooth transition for both employers and candidates.</li></ul><p><strong>Employer Branding and Positioning:</strong></p><ul><li>Jupiter collaborates with employers to understand their unique needs, organizational culture, and specific requirements.</li><li>They position the employer brand in a way that attracts top talent, showcasing the organization as an employer of choice in the recruitment market.</li></ul><p><strong>Consultation and Strategic Planning:</strong></p><ul><li>Jupiter offers consultation services to employers, helping them understand market trends, identify talent gaps, and develop effective recruitment strategies.</li><li>They provide insights into the evolving recruitment landscape, offering tailored solutions to align with the changing demands of the industry.</li></ul><p><strong>Value-added Services:</strong></p><ul><li>Jupiter goes beyond traditional recruitment services, offering additional value-added solutions such as pre-employment training, language courses, and orientation programs for newly hired candidates.</li><li>These services enhance the overall recruitment experience and ensure the smooth integration of candidates into the employer\'s workforce.</li></ul><p>Jupiter Overseas Concern Pvt. Ltd. strives to be a reliable and strategic partner for employers, providing tailored solutions to meet their unique recruitment needs and ensure long-term success in hiring top-notch talent.</p>', '', 25, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(45, 0, 'testimonials', 'testimonials', '<p>bla</p>', '', 26, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(46, 45, 'Ram Karki', 'first_student', '<p>Working with Jupiter Overseas has been an absolute pleasure. Their team demonstrated a deep understanding of our business requirements and went above and beyond to find us the best candidates. Their thorough screening process ensured that only the most qualified individuals were presented to us. Jupiter\'s commitment to excellence, transparency, and strong work ethic has made them our preferred recruitment partner. We couldn\'t be happier with the results they have delivered.</p>', '', 27, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(47, 0, 'About Nepal', 'about_nepal', '<p>Nepal, a landlocked country situated in South Asia, has witnessed a significant rise in foreign employment in recent years. Foreign employment has become a crucial aspect of Nepal\'s economy, offering employment opportunities to thousands of Nepalese citizens. The demand for Nepalese workers in various sectors, such as construction, hospitality, healthcare, and domestic work, has been steadily increasing, primarily driven by countries in the Middle East, Southeast Asia, and other parts of the world.</p><p>Foreign employment has emerged as a lifeline for many Nepalese families, providing economic stability and remittances that contribute significantly to the country\'s GDP. It has played a vital role in poverty reduction, improving living standards, and supporting infrastructure development. However, it also poses challenges such as labor exploitation, unsafe working conditions, and social issues arising from family separation.</p><p>To address these challenges, the Nepalese government, in collaboration with recruitment agencies and international organizations, has been taking steps to safeguard the rights and welfare of Nepalese migrant workers. Initiatives include pre-departure orientation programs, skill development training, and bilateral agreements to ensure fair recruitment practices and protect the rights of workers.</p><p>Foreign employment continues to be a significant aspect of Nepal\'s socio-economic landscape, offering opportunities for employment and economic growth while requiring ongoing efforts to ensure the well-being and protection of its migrant workforce.</p>', '', 28, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(48, 0, 'Tips for Interviews', 'tips_for_interviews', '<p>Preparing for an interview for foreign employment requires careful consideration of cultural differences, understanding the job requirements, and showcasing your skills and experience effectively. Here are some tips to help you excel in your interview:</p><p><strong>Research the Company and Culture:</strong></p><ul><li>Learn about the company you\'re interviewing with, including its values, mission, and work culture.</li><li>Familiarize yourself with the cultural norms and business practices of the country where the company is based.</li></ul><p><strong>Understand the Job Requirements:</strong></p><ul><li>Thoroughly review the job description and understand the skills and qualifications they are seeking.</li><li>Identify how your experience, skills, and expertise align with the job requirements.</li></ul><p><strong>Prepare Answers to Common Questions:</strong></p><ul><li>Anticipate common interview questions and prepare well-thought-out answers.</li><li>Highlight your accomplishments, problem-solving abilities, and experiences that demonstrate your suitability for the role.</li></ul><p><strong>Showcase Your Language Skills:</strong></p><ul><li>If the job requires proficiency in a particular language, practice and demonstrate your language skills during the interview.</li><li>Be confident in your ability to communicate effectively in the language required for the job.</li></ul><p><strong>Emphasize Cross-Cultural Adaptability:</strong></p><ul><li>Showcase your experience and ability to adapt to different cultures and work environments.</li><li>Highlight any previous international experience or instances where you successfully worked with diverse teams.</li></ul><p><strong>Display Professionalism and Etiquette:</strong></p><ul><li>Dress professionally for the interview, considering cultural norms and expectations.</li><li>Practice proper interview etiquette, such as arriving on time, maintaining good posture, and demonstrating active listening.</li></ul><p><strong>Prepare Questions to Ask:</strong></p><ul><li>Prepare thoughtful questions to ask the interviewer about the company, the role, and the work environment.</li><li>This demonstrates your interest and engagement in the opportunity.</li></ul><p><strong>Showcase Your Problem-Solving Skills:</strong></p><ul><li>Be prepared to discuss real-life scenarios where you encountered challenges and how you resolved them.</li><li>Highlight your critical thinking, problem-solving abilities, and adaptability to unfamiliar situations.</li></ul><p><strong>Practice Cultural Sensitivity:</strong></p><ul><li>Be aware of cultural nuances and avoid making assumptions or stereotypes during the interview.</li><li>Show respect for diverse perspectives and demonstrate your ability to work effectively with people from different backgrounds.</li></ul><p><strong>Follow-Up with a Thank You:</strong></p><ul><li>After the interview, send a thank-you note or email to express your gratitude and reiterate your interest in the position.</li><li>Use this opportunity to briefly highlight any key points you may have missed during the interview.</li></ul>', '', 29, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(49, 45, 'Jiwan Khadka', 'jiwan_khadka', '<p>I am extremely grateful to Jupiter Overseas for their exceptional recruitment services. They understood our organization\'s unique needs and provided us with top-quality candidates who perfectly fit our requirements. Their professionalism, attention to detail, and timely communication made the entire hiring process seamless. Thanks to Jupiter, we have successfully built a strong team of talented individuals who have greatly contributed to our company\'s success.</p>', '', 30, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(50, 45, 'Birendra Magar', 'birendra_magar', '<p>Jupiter Overseas has been a reliable partner in our recruitment efforts. Their in-depth understanding of the industry and market trends enabled them to present us with highly qualified candidates who exceeded our expectations. Their dedication, professionalism, and commitment to finding the right talent have been commendable. We highly recommend Jupiter for their exceptional service and strategic approach to recruitment.</p>', '', 34, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(51, 38, 'How can I apply for foreign employment through Jupiter Overseas?', 'how_can_i_apply_for_foreign_employment_through_jupiter_overseas', '<p>To apply for foreign employment through Jupiter Overseas, you can visit their website and look for the available job vacancies. Follow the application instructions provided and submit your resume along with any required documents. Alternatively, you can contact their office for further guidance.</p>', '', 32, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
(52, 38, 'What countries does Jupiter Overseas offer foreign employment opportunities in?', 'what_countries_does_jupiter_overseas_offer_foreign_employment_opportunities_in', '<p>Jupiter Overseas offers foreign employment opportunities in various countries, including but not limited to those in the Middle East, Southeast Asia, and other parts of the world. The specific countries and job opportunities may vary based on the current demand and client requirements.</p>', '', 33, 1, NULL, '2023-07-13 22:23:18', NULL, 1),
