(10, 'Kuwait', 'kuwait', '<p>Kuwait, Gulf Arabic, officially the State of Kuwait, is a country in West Asia. It is situated in the northern edge of Eastern Arabia at the tip of the Persian Gulf, bordering Iraq to the north and Saudi Arabia to the south.[9] Kuwait also shares maritime borders with Iran. Kuwait has a coastal length of approximately 500 km (311 mi).[10] Most of the country&#39;s population reside in the urban agglomeration of the capital and largest city Kuwait City.[11] As of 2022, Kuwait has a population of 4.45 million people of which 1.45 million are Kuwaiti citizens while the remaining 3.00 million are foreign nationals from over 100 countries.</p>', '<p>Kuwait, Gulf Arabic, officially the State of Kuwait, is a country in West Asia. It is situated in the northern edge of Eastern Arabia at the tip of the Persian Gulf, bordering Iraq to the north and Saudi Arabia to the south.[9] Kuwait also shares maritime borders with Iran. Kuwait has a coastal length of approximately 500 km (311 mi).[10] Most of the country&#39;s population reside in the urban agglomeration of the capital and largest city Kuwait City.[11] As of 2022, Kuwait has a population of 4.45 million people of which 1.45 million are Kuwaiti citizens while the remaining 3.00 million are foreign nationals from over 100 countries.</p>\r\n\r\n<p>Historically, most of present-day Kuwait was part of ancient Mesopotamia.[12][13][14] Pre-oil Kuwait was a strategic trade port between Mesopotamia, Persia and India. Oil reserves were discovered in commercial quantities in 1938. In 1946, crude oil was exported for the first time.[15][16] From 1946 to 1982, the country underwent large-scale modernization, largely based on income from oil production. In the 1980s, Kuwait experienced a period of geopolitical instability and an economic crisis following the stock market crash. In 1990, after oil production disputes with neighbouring Iraq, Kuwait was invaded, and later annexed into one of Iraq&#39;s governorates by Iraq under Saddam Hussein.[17] The Iraqi occupation of Kuwait came to an end on February 26, 1991, after military intervention by a military coalition led by the United States and various other countries.</p>', '', 'storage/files/1/kuwait.jpeg', 10, 1, NULL, '2023-07-17 22:27:36', NULL, 1),
