INSERT INTO `tbl_job_categories` (`category_id`, `title`, `alias`, `thumb`, `details`, `display_order`, `status`, `created_at`, `updated_at`, `createdby`, `updatedby`) VALUES
(1, 'Hotel & Caterings', 'hotel_&_caterings', 'storage/files/1/01.jpg', '<p>We understand the importance of providing excellent hotel and catering services for our clients. Our partner hotels offer a wide range of amenities and services to ensure that our clients have a comfortable and enjoyable stay. From luxurious guest rooms and suites to state-of-the-art meeting facilities, our partner hotels provide everything needed for a successful event. They also offer top-notch customer service and support, ensuring that every guest feels valued and taken care of.</p>\r\n\r\n<p>In terms of catering, we partner with reputable catering companies that are known for their delicious and innovative cuisine. Whether our clients are looking for a simple coffee break, a light lunch, or a formal dinner, our catering partners can provide customized menus to suit their specific needs and preferences. They also offer a range of dietary options, including vegetarian and gluten-free options, to accommodate guests with special dietary needs.</p>\r\n\r\n<ul>\r\n	<li>Room Attendants / Bell Boys</li>\r\n	<li>Kitchen Stewards /Asst. Cooks</li>\r\n	<li>Electrician/A/C Mechanic</li>\r\n	<li>Mechanic/Plumber/Carpenter/Painter</li>\r\n	<li>Cashiers/Accounts Assistants/ Auditors</li>\r\n	<li>F &amp; B Captains</li>\r\n	<li>Chef-de-partie &amp; Sous Chef</li>\r\n	<li>Secretary/Business Centre Asst.</li>\r\n	<li>Pastry Man/Baker Confectioner</li>\r\n	<li>Cook continental Chinese, Indian</li>\r\n	<li>Pastry Man/Baker Confectioner</li>\r\n	<li>Dishwasher / Laundry</li>\r\n</ul>', 1, 1, NULL, '2023-07-15 21:44:09', NULL, 1),
(2, 'Security Sector', 'security_sector', 'storage/files/1/04.jpg', '<p>Our security partners provide a wide range of services, including on-site security personnel, access control, CCTV surveillance, and more. They are known for their expertise in risk assessment, threat management, and emergency response, ensuring that our clients are well-protected at all times. Our security partners are committed to continuous training and development to ensure that their personnel have the necessary skills and knowledge to provide exceptional security services. At our human resource company, we recognize the importance of personalized security services that are tailored to the specific needs and requirements of our clients. That is why we work closely with our clients to understand their unique security needs and develop customized security solutions that address those needs effectively.</p>\r\n\r\n<ul>\r\n	<li>Watch Man</li>\r\n	<li>Secuirty Of?cer</li>\r\n	<li>Security Supervisor</li>\r\n	<li>Civil Security Guard</li>\r\n	<li>Body Guard</li>\r\n	<li>Male / Female Security</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, NULL, '2023-07-15 21:44:27', NULL, 1),
(3, 'Engineering and Construction', 'engineering_and_construction', 'storage/files/1/02.jpg', '<p>At our human resource company, we are committed to providing our clients with exceptional engineering and construction services. We work closely with our clients and our partners to ensure that every aspect of the project is executed flawlessly, from start to finish. Our company is committed to partnering with only the best engineering and construction firms to ensure that our clients receive top- notch services. Our engineering partners have a proven track record of delivering high-quality designs, plans, and specifications for a wide range of projects. Whether our clients need assistance with civil, mechanical, electrical, or structural engineering, our partners have the expertise and experience to provide innovative solutions that meet their needs.</p>\r\n\r\n<p>Our construction partners are equally skilled and experienced in delivering top- notch construction services for projects of all sizes and complexity. They have a reputation for delivering projects on time, on budget, and to the highest standards of quality. Whether our clients need assistance with project management, site preparation, or building construction, our partners can provide the necessary services to ensure a successful outcome.</p>\r\n\r\n<ul>\r\n	<li>Engineers</li>\r\n	<li>Supervisors</li>\r\n	<li>Quality Surveyor</li>\r\n	<li>Safety Of?cer</li>\r\n	<li>Foreman / Plumber / Carpentry</li>\r\n	<li>Heavy Equipment Operators</li>\r\n	<li>Heavy / Light Driver</li>\r\n	<li>Concerte Pump Operator</li>\r\n	<li>Mason - Tile / Block / Plaster</li>\r\n	<li>Painter - Spray / Roller</li>\r\n	<li>Scaffolder</li>\r\n	<li>Skilled Labours</li>\r\n	<li>Unskilled Labours</li>\r\n</ul>', 1, 1, NULL, '2023-07-15 21:44:47', NULL, 1),
(4, 'FMCG & Retailing', 'fmcg_&_retailing', 'storage/files/1/03.jpg', '<p>Our company partners with leading FMCG and retailing firms to ensure that our clients receive top-notch services. Our FMCG partners provide a wide range of products that are designed to meet the needs of consumers across various categories, including food and beverage, personal care, home care, and more. They are known for delivering high-quality products that are safe, reliable, and affordable. Our FMCG partners are committed to innovation and continuous improvement, constantly developing new products and refining existing ones to better meet the needs of consumers.</p>\r\n\r\n<p>Our retailing partners are equally skilled and experienced in delivering exceptional retailing services for both online and brick-and-mortar stores. They have a deep understanding of consumer behavior and are skilled in developing retail strategies that drive sales and build brand loyalty. Our retailing partners provide end-to-end retail solutions, including store design and layout, inventory management, pricing and promotions, and customer service.</p>\r\n\r\n<ul>\r\n	<li>Sales (Male/Female)</li>\r\n	<li>Assistant Sales</li>\r\n	<li>Store keeper</li>\r\n	<li>Accountants</li>\r\n	<li>Assistant / Jr. Accountants</li>\r\n	<li>Cashiers</li>\r\n	<li>Data Entry Operators</li>\r\n	<li>Cleaners (Male/Female)</li>\r\n	<li>Loader / Unloader</li>\r\n	<li>Delivery boys</li>\r\n</ul>', 1, 1, NULL, '2023-07-15 21:45:06', NULL, 1);
