(NULL, 1884, 1, 202307160329096752, 202307160329096752, 'App\\Models\\Job_categories', 1, 'update', '{\"category_id\":1,\"title\":\"Hotel & Caterings\",\"alias\":\"hotel_&_caterings\",\"thumb\":\"\\/uploads\\/images\\/01.jpg\",\"details\":\"<p>We understand the importance of providing excellent hotel and catering services for our clients. Our partner hotels offer a wide range of amenities and services to ensure that our clients have a comfortable and enjoyable stay. From luxurious guest rooms and suites to state-of-the-art meeting facilities, our partner hotels provide everything needed for a successful event. They also offer top-notch customer service and support, ensuring that every guest feels valued and taken care of.<\\/p><p>In terms of catering, we partner with reputable catering companies that are known for their delicious and innovative cuisine. Whether our clients are looking for a simple coffee break, a light lunch, or a formal dinner, our catering partners can provide customized menus to suit their specific needs and preferences. They also offer a range of dietary options, including vegetarian and gluten-free options, to accommodate guests with special dietary needs.<\\/p><ul><li>Room Attendants \\/ Bell Boys<\\/li><li>Kitchen Stewards \\/Asst. Cooks<\\/li><li>Electrician\\/A\\/C Mechanic<\\/li><li>Mechanic\\/Plumber\\/Carpenter\\/Painter<\\/li><li>Cashiers\\/Accounts Assistants\\/ Auditors<\\/li><li>F &amp; B Captains<\\/li><li>Chef-de-partie &amp; Sous Chef<\\/li><li>Secretary\\/Business Centre Asst.<\\/li><li>Pastry Man\\/Baker Confectioner<\\/li><li>Cook continental Chinese, Indian<\\/li><li>Pastry Man\\/Baker Confectioner<\\/li><li>Dishwasher \\/ Laundry<\\/li><\\/ul>\",\"display_order\":1,\"status\":1,\"created_at\":null,\"updated_at\":null,\"createdby\":null,\"updatedby\":null,\"status_name\":\"<span class=\\\"badge text-bg-success-soft\\\"> Active <\\/span>\"}', '{\"thumb\":\"storage\\/files\\/1\\/01.jpg\",\"details\":\"<p>We understand the importance of providing excellent hotel and catering services for our clients. Our partner hotels offer a wide range of amenities and services to ensure that our clients have a comfortable and enjoyable stay. From luxurious guest rooms and suites to state-of-the-art meeting facilities, our partner hotels provide everything needed for a successful event. They also offer top-notch customer service and support, ensuring that every guest feels valued and taken care of.<\\/p>\\r\\n\\r\\n<p>In terms of catering, we partner with reputable catering companies that are known for their delicious and innovative cuisine. Whether our clients are looking for a simple coffee break, a light lunch, or a formal dinner, our catering partners can provide customized menus to suit their specific needs and preferences. They also offer a range of dietary options, including vegetarian and gluten-free options, to accommodate guests with special dietary needs.<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Room Attendants \\/ Bell Boys<\\/li>\\r\\n\\t<li>Kitchen Stewards \\/Asst. Cooks<\\/li>\\r\\n\\t<li>Electrician\\/A\\/C Mechanic<\\/li>\\r\\n\\t<li>Mechanic\\/Plumber\\/Carpenter\\/Painter<\\/li>\\r\\n\\t<li>Cashiers\\/Accounts Assistants\\/ Auditors<\\/li>\\r\\n\\t<li>F &amp; B Captains<\\/li>\\r\\n\\t<li>Chef-de-partie &amp; Sous Chef<\\/li>\\r\\n\\t<li>Secretary\\/Business Centre Asst.<\\/li>\\r\\n\\t<li>Pastry Man\\/Baker Confectioner<\\/li>\\r\\n\\t<li>Cook continental Chinese, Indian<\\/li>\\r\\n\\t<li>Pastry Man\\/Baker Confectioner<\\/li>\\r\\n\\t<li>Dishwasher \\/ Laundry<\\/li>\\r\\n<\\/ul>\",\"updated_at\":\"2023-07-16 03:29:09\",\"updatedBy\":1}', '2023-07-15 21:44:09', '2023-07-15 21:44:09'),
(NULL, 1885, 1, 202307160329271579, 202307160329271579, 'App\\Models\\Job_categories', 2, 'update', '{\"category_id\":2,\"title\":\"Security Sector\",\"alias\":\"security_sector\",\"thumb\":\"\\/uploads\\/images\\/04.jpg\",\"details\":\"<p>Our security partners provide a wide range of services, including on-site security personnel, access control, CCTV surveillance, and more. They are known for their expertise in risk assessment, threat management, and emergency response, ensuring that our clients are well-protected at all times. Our security partners are committed to continuous training and development to ensure that their personnel have the necessary skills and knowledge to provide exceptional security services. At our human resource company, we recognize the importance of personalized security services that are tailored to the specific needs and requirements of our clients. That is why we work closely with our clients to understand their unique security needs and develop customized security solutions that address those needs effectively.<\\/p><ul><li>Watch Man<\\/li><li>Secuirty Of?cer<\\/li><li>Security Supervisor<\\/li><li>Civil Security Guard<\\/li><li>Body Guard<\\/li><li>Male \\/ Female Security<\\/li><\\/ul><p>&nbsp;<\\/p><p>&nbsp;<\\/p>\",\"display_order\":1,\"status\":1,\"created_at\":null,\"updated_at\":null,\"createdby\":null,\"updatedby\":null,\"status_name\":\"<span class=\\\"badge text-bg-success-soft\\\"> Active <\\/span>\"}', '{\"thumb\":\"storage\\/files\\/1\\/04.jpg\",\"details\":\"<p>Our security partners provide a wide range of services, including on-site security personnel, access control, CCTV surveillance, and more. They are known for their expertise in risk assessment, threat management, and emergency response, ensuring that our clients are well-protected at all times. Our security partners are committed to continuous training and development to ensure that their personnel have the necessary skills and knowledge to provide exceptional security services. At our human resource company, we recognize the importance of personalized security services that are tailored to the specific needs and requirements of our clients. That is why we work closely with our clients to understand their unique security needs and develop customized security solutions that address those needs effectively.<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Watch Man<\\/li>\\r\\n\\t<li>Secuirty Of?cer<\\/li>\\r\\n\\t<li>Security Supervisor<\\/li>\\r\\n\\t<li>Civil Security Guard<\\/li>\\r\\n\\t<li>Body Guard<\\/li>\\r\\n\\t<li>Male \\/ Female Security<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\",\"updated_at\":\"2023-07-16 03:29:27\",\"updatedBy\":1}', '2023-07-15 21:44:27', '2023-07-15 21:44:27'),
(NULL, 1886, 1, 202307160329471588, 202307160329471588, 'App\\Models\\Job_categories', 3, 'update', '{\"category_id\":3,\"title\":\"Engineering and Construction\",\"alias\":\"engineering_and_construction\",\"thumb\":\"\\/uploads\\/images\\/02.jpg\",\"details\":\"<p>At our human resource company, we are committed to providing our clients with exceptional engineering and construction services. We work closely with our clients and our partners to ensure that every aspect of the project is executed flawlessly, from start to finish. Our company is committed to partnering with only the best engineering and construction firms to ensure that our clients receive top- notch services. Our engineering partners have a proven track record of delivering high-quality designs, plans, and specifications for a wide range of projects. Whether our clients need assistance with civil, mechanical, electrical, or structural engineering, our partners have the expertise and experience to provide innovative solutions that meet their needs.<\\/p><p>Our construction partners are equally skilled and experienced in delivering top- notch construction services for projects of all sizes and complexity. They have a reputation for delivering projects on time, on budget, and to the highest standards of quality. Whether our clients need assistance with project management, site preparation, or building construction, our partners can provide the necessary services to ensure a successful outcome.<\\/p><ul><li>Engineers<\\/li><li>Supervisors<\\/li><li>Quality Surveyor<\\/li><li>Safety Of?cer<\\/li><li>Foreman \\/ Plumber \\/ Carpentry<\\/li><li>Heavy Equipment Operators<\\/li><li>Heavy \\/ Light Driver<\\/li><li>Concerte Pump Operator<\\/li><li>Mason - Tile \\/ Block \\/ Plaster<\\/li><li>Painter - Spray \\/ Roller<\\/li><li>Scaffolder<\\/li><li>Skilled Labours<\\/li><li>Unskilled Labours<\\/li><\\/ul>\",\"display_order\":1,\"status\":1,\"created_at\":null,\"updated_at\":null,\"createdby\":null,\"updatedby\":null,\"status_name\":\"<span class=\\\"badge text-bg-success-soft\\\"> Active <\\/span>\"}', '{\"thumb\":\"storage\\/files\\/1\\/02.jpg\",\"details\":\"<p>At our human resource company, we are committed to providing our clients with exceptional engineering and construction services. We work closely with our clients and our partners to ensure that every aspect of the project is executed flawlessly, from start to finish. Our company is committed to partnering with only the best engineering and construction firms to ensure that our clients receive top- notch services. Our engineering partners have a proven track record of delivering high-quality designs, plans, and specifications for a wide range of projects. Whether our clients need assistance with civil, mechanical, electrical, or structural engineering, our partners have the expertise and experience to provide innovative solutions that meet their needs.<\\/p>\\r\\n\\r\\n<p>Our construction partners are equally skilled and experienced in delivering top- notch construction services for projects of all sizes and complexity. They have a reputation for delivering projects on time, on budget, and to the highest standards of quality. Whether our clients need assistance with project management, site preparation, or building construction, our partners can provide the necessary services to ensure a successful outcome.<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Engineers<\\/li>\\r\\n\\t<li>Supervisors<\\/li>\\r\\n\\t<li>Quality Surveyor<\\/li>\\r\\n\\t<li>Safety Of?cer<\\/li>\\r\\n\\t<li>Foreman \\/ Plumber \\/ Carpentry<\\/li>\\r\\n\\t<li>Heavy Equipment Operators<\\/li>\\r\\n\\t<li>Heavy \\/ Light Driver<\\/li>\\r\\n\\t<li>Concerte Pump Operator<\\/li>\\r\\n\\t<li>Mason - Tile \\/ Block \\/ Plaster<\\/li>\\r\\n\\t<li>Painter - Spray \\/ Roller<\\/li>\\r\\n\\t<li>Scaffolder<\\/li>\\r\\n\\t<li>Skilled Labours<\\/li>\\r\\n\\t<li>Unskilled Labours<\\/li>\\r\\n<\\/ul>\",\"updated_at\":\"2023-07-16 03:29:47\",\"updatedBy\":1}', '2023-07-1