(NULL, 1887, 1, 202307160330065379, 202307160330065379, 'App\\Models\\Job_categories', 4, 'update', '{\"category_id\":4,\"title\":\"FMCG & Retailing\",\"alias\":\"fmcg_&_retailing\",\"thumb\":\"\\/uploads\\/images\\/03.jpg\",\"details\":\"<p>Our company partners with leading FMCG and retailing firms to ensure that our clients receive top-notch services. Our FMCG partners provide a wide range of products that are designed to meet the needs of consumers across various categories, including food and beverage, personal care, home care, and more. They are known for delivering high-quality products that are safe, reliable, and affordable. Our FMCG partners are committed to innovation and continuous improvement, constantly developing new products and refining existing ones to better meet the needs of consumers.<\\/p><p>Our retailing partners are equally skilled and experienced in delivering exceptional retailing services for both online and brick-and-mortar stores. They have a deep understanding of consumer behavior and are skilled in developing retail strategies that drive sales and build brand loyalty. Our retailing partners provide end-to-end retail solutions, including store design and layout, inventory management, pricing and promotions, and customer service.<\\/p><ul><li>Sales (Male\\/Female)<\\/li><li>Assistant Sales<\\/li><li>Store keeper<\\/li><li>Accountants<\\/li><li>Assistant \\/ Jr. Accountants<\\/li><li>Cashiers<\\/li><li>Data Entry Operators<\\/li><li>Cleaners (Male\\/Female)<\\/li><li>Loader \\/ Unloader<\\/li><li>Delivery boys<\\/li><\\/ul>\",\"display_order\":1,\"status\":1,\"created_at\":null,\"updated_at\":null,\"createdby\":null,\"updatedby\":null,\"status_name\":\"<span class=\\\"badge text-bg-success-soft\\\"> Active <\\/span>\"}', '{\"thumb\":\"storage\\/files\\/1\\/03.jpg\",\"details\":\"<p>Our company partners with leading FMCG and retailing firms to ensure that our clients receive top-notch services. Our FMCG partners provide a wide range of products that are designed to meet the needs of consumers across various categories, including food and beverage, personal care, home care, and more. They are known for delivering high-quality products that are safe, reliable, and affordable. Our FMCG partners are committed to innovation and continuous improvement, constantly developing new products and refining existing ones to better meet the needs of consumers.<\\/p>\\r\\n\\r\\n<p>Our retailing partners are equally skilled and experienced in delivering exceptional retailing services for both online and brick-and-mortar stores. They have a deep understanding of consumer behavior and are skilled in developing retail strategies that drive sales and build brand loyalty. Our retailing partners provide end-to-end retail solutions, including store design and layout, inventory management, pricing and promotions, and customer service.<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Sales (Male\\/Female)<\\/li>\\r\\n\\t<li>Assistant Sales<\\/li>\\r\\n\\t<li>Store keeper<\\/li>\\r\\n\\t<li>Accountants<\\/li>\\r\\n\\t<li>Assistant \\/ Jr. Accountants<\\/li>\\r\\n\\t<li>Cashiers<\\/li>\\r\\n\\t<li>Data Entry Operators<\\/li>\\r\\n\\t<li>Cleaners (Male\\/Female)<\\/li>\\r\\n\\t<li>Loader \\/ Unloader<\\/li>\\r\\n\\t<li>Delivery boys<\\/li>\\r\\n<\\/ul>\",\"updated_at\":\"2023-07-16 03:30:06\",\"updatedBy\":1}', '2023-07-15 21:45:06', '2023-07-15 21:45:06'),
