INSERT INTO `tbl_recruitmentarticles` (`article_id`, `parent_article`, `title`, `alias`, `text`, `cover_photo`, `display_order`, `status`, `created_at`, `updated_at`, `createdby`, `updatedby`) VALUES
(1, 0, 'Processing Procedure and Time Frame', 'processing_procedure_and_time_frame', '<p><img alt=\"\" src=\"/uploads/images/recruitment_process_niwida.jpg\" style=\"height:927px; width:827px\" /></p>\r\n', '', 2, 1, NULL, '2023-07-13 23:50:41', NULL, 1),
(2, 0, 'Selection Procedure', 'selection_procedure', '<p style=\"text-align:justify\">There are mainly four selection procedures that the Co.,&nbsp;<span style=\"color:rgb(52, 167, 222)\">as a rule, conducts and follows.</span></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Direct Personal Interview (DPI) and test conducted by the Employer</strong></p>\r\n\r\n<p><img alt=\"\" src=\"/uploads/images/selection.png\" style=\"float:right; height:150px; width:150px\" /></p>\r\n\r\n<div>\r\n<p style=\"text-align:justify\">Employers can make their own selection procedures like direct personal interview and the necessary test at the Company Office in Nepal - for those potential workers (skilled, semi-skilled and un-skilled) who are preliminary listed and short-listed by&nbsp;<strong>NIWIDA Concern Pvt. Ltd.</strong></p>\r\n\r\n<p style=\"text-align:justify\"><strong>Selection by the Company (NIWIDA Concern Pvt. Ltd.)</strong></p>\r\n\r\n<p style=\"text-align:justify\">In the absence of Employers, the Co. conducts their own selection procedures and as a result display workers to their employment destination under its full supervision and guarantee. For this, well-trained and experienced staff works dedicatedly to recruit the right people for the right jobs.</p>\r\n<img alt=\"Document Review\" src=\"/uploads/images/selection-2.png\" style=\"border:none; color:rgb(85, 85, 85); float:right; font-family:arial,helvetica,sans-serif; font-size:12px; height:150px; line-height:16px; margin:15px 0px; padding:5px; width:150px\" title=\"Documents Review\" />\r\n<p style=\"text-align:justify\"><strong>Selection by Documents Review</strong></p>\r\n</div>\r\n\r\n<div>&nbsp;\r\n<p style=\"text-align:justify\">Other type of selection procedure, which we called, the &quot;Documents Review&quot; of the potential candidates is also available for the employers. For this, the employers may request for the pre-selected documents No-data, academic certificates, work experience, language knowledge etc.) of the potential candidates by courier or postal service.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Video Conference</strong><img alt=\"Video Conference\" src=\"/uploads/images/selection-3.png\" style=\"border:none; color:rgb(85, 85, 85); float:right; font-family:arial,helvetica,sans-serif; font-size:12px; height:150px; line-height:16px; margin:15px 0px; padding:5px; width:150px\" title=\"Video Conference\" /></p>\r\n\r\n<p style=\"text-align:justify\">For the consistency of employees and theirs job, a video conference is conducted. This will generally help add to accept as true and have faith in the company and its recruitment and selection procedures.</p>\r\n</div>\r\n', '', 3, 1, NULL, '2023-07-13 23:50:41', NULL, 1),
(3, 0, 'Required Documents', 'required_documents', '<p>The requirement of documents usually varies from country to country but principally these types of documents are essential such as;</p><ul><li>Demand Letter</li><li>Power of AHomey</li><li>Inter Party Agreement</li><li>Employment Contract</li><li>Gurantee Letter</li></ul><p>To be able to obtain the approval letter from the Government of Nepal, the following documents are, In principle,required for government formalities and procedures;</p><p><br><strong>Demand Letter</strong></p><p>Addressed to authorizing NIWIDA Concern Pvt. Ltd.(License No.711/064-065) Kathmandu Nepal mentioning the number of workers required in each categories with salary,duty hour,food, accommodation &amp; other benefi1s to workers.</p><p><strong>Power of Attorney</strong></p><p>Authorizing NIWIDA Concern Pvt.Ltd.(License No.711/084-065) Kathmandu,Nepalto be true and lawful attorney and agent of Nepal.&nbsp;</p><p><strong>Inter Party Agreement</strong></p><p>One copy each signed and stamped by the employer and recruiting agency.</p><p><strong>Employment Contract</strong></p><p>One copy each signed and stamped by the employer &amp; employee.</p><p><strong>Gurantee Letter</strong></p><p>Signed and stamped copy by the employer company should be mention that not to be deploy to other countries<br>tor work purpose.</p><p><strong>For the Kingdom of Saudi Arabia</strong></p><p>Following additionaldocuments are essential for KSA only.<br>Authorization Letter/Counselor Letter,Company Registration(CR) copy,Visa Slip (Bank<br>Slip).Note: Authorization Letter should be prepared by local agency.</p><p>Note:Documents should be duly S6819d &amp; signed by the Minister of Foreign Affaira,Chamber of<br>Commerce or concemed Govemment Authority &amp; Nepalese Embsssy of the respective countly.</p>', '', 4, 1, NULL, '2023-07-13 23:50:41', NULL, 1),
